import React from 'react'
import { useDispatch } from 'react-redux'

export default function LogOut(){



    return(
        <div className="logout-component">
           <button onClick={useDispatch({type: 'not logged in'})} className="logout-btn">LogOut</button>
        </div>
    )


}
